body:
This appears to have been broken by an update to the external `csstype` package (depended on by `react`). The data here comes from `react.CSSProperties` which is declared as:
```ts
export interface CSSProperties extends CSS.Properties<string | number> {
    // The string index signature fallback is needed at least until csstype
    // provides SVG CSS properties: https://github.com/frenic/csstype/issues/4
    [propertyName: string]: any;
}
```
Previously `fill` would be matched by the index signature, now it is declared by `CSS.Properties` as a string. I don't know what is wrong here -- `victory`, `react`, `csstype`, or the test. (But the test is the easiest one to change...)

CC @frenic @pelotom @johnnyreilly @Kovensky 
